                        <div class="slide__text">
                            <h2 class="slide__text-heading">Chilika</h2>
                            <p class="slide__text-desc">The vast and dream like Chilika Lagoon is situated on the east-coast of India. It is the largest brackish Water Lagoon with estuarine character that sprawls along the east coast. It is the largest wintering ground for migratory waterfowl found anywhere on the Indian sub-continent. It is one of the hotspot of biodiversity in the country, and some rare, vulnerable and endangered species listed in the IUCN Red List of threatened Animals inhabit in the lagoon for atleast part of their life cycle.</p>
