                        <path class="slide__overlay-path" d="M0,0 150,0 500,405 0,405" />
                    </svg>
                        <div class="slide__text">
                            <h2 class="slide__text-heading">Konark</h2>
                            <p class="slide__text-desc">An Architecture Marvel of Eastern India and A symbol of India's heritage, Konark Sun Temple, commonly known as Konark is situated in the eastern state of Odisha (earlier known as Orissa), India and is one of the eminent tourist attractions. Konark houses a massive temple dedicated to the Sun God. The word 'Konark' is a combination of two words 'Kona' and 'Arka'. 'Kona' means 'Corner' and 'Arka' means 'Sun', so when combines it becomes 'Sun of the Corner'. Konark Sun Temple is situated on the north eastern corner of Puri and is dedicated to Sun God. Konark is also known as Arka khetra. </p>
        
                        </div>
