                        </svg>
                        <div class="slide__text">
                        <h2 class="slide__text-heading">Puri</h2>
                        <p class="slide__text-desc">
                        Puri District is a coastal District on the eastern part of Odisha, India. This District needs no introduction, being the abode of Lord Vishnu, most popularly known as Lord Jagannath. This District derives its name from the heritage city of Puri, one of the four pilgrimage centres of India. Covering an area of 3051 sq/kms, the District may be divided into two dissimilar natural divisions-the Littoral tract and the Level alluvial tract.</p>
             
